import React from 'react'
import logo from "../assets/Logo.svg"
import {NavLink} from "react-router-dom"

const Navbar = () => {
  return (
    <div>
    <NavLink to="/">
        <img src={logo} alt="Logo" width={160} height={32} loading="lazy"/>
    </NavLink> 


    </div>
  )
}

export default Navbar
